lut3 brussel_lookup( float a, float b )
{
    lut3 lc;
  
    a = (a - BRUSSEL_A_MIN) / ((BRUSSEL_A_MAX - BRUSSEL_A_MIN) / (A_STEPS - 1));
    b = (b - BRUSSEL_B_MIN) / ((BRUSSEL_B_MAX - BRUSSEL_B_MIN) / (B_STEPS - 1));

    size_t a_index = (size_t) a;
    size_t b_index = (size_t) b;

    float a_frac = a - a_index;
    float b_frac = b - b_index;
    a_index = clamps( 0, A_STEPS - 2, a_index );
    b_index = clamps( 0, B_STEPS - 2, b_index );

    size_t i00 = a_index * B_STEPS + b_index;
    size_t i10 = (a_index + 1) * B_STEPS + b_index;
    size_t i01 = a_index * B_STEPS + (b_index + 1);
    size_t i11 = (a_index + 1) * B_STEPS + (b_index + 1);

    float p00 = brussel_period_lut[i00];
    float p10 = brussel_period_lut[i10];
    float p01 = brussel_period_lut[i01];
    float p11 = brussel_period_lut[i11];
    float p0  = lerp( p00, p01, b_frac );
    float p1  = lerp( p10, p11, b_frac );
    lc.period = lerp( p0, p1, a_frac );

    float gmax00 = brussel_gmax_lut[i00];
    float gmax10 = brussel_gmax_lut[i10];
    float gmax01 = brussel_gmax_lut[i01];
    float gmax11 = brussel_gmax_lut[i11];
    float gmax0  = lerp( gmax00, gmax01, b_frac );
    float gmax1  = lerp( gmax10, gmax11, b_frac );
    lc.gmax      = lerp( gmax0, gmax1, a_frac );

    float gmin00 = brussel_gmin_lut[i00];
    float gmin10 = brussel_gmin_lut[i10];
    float gmin01 = brussel_gmin_lut[i01];
    float gmin11 = brussel_gmin_lut[i11];
    float gmin0  = lerp( gmin00, gmin01, b_frac );
    float gmin1  = lerp( gmin10, gmin11, b_frac );
    lc.gmin      = lerp( gmin0, gmin1, a_frac );

    return lc;
}
